import React from "react";

const NavBar = () => {
  <div className="header">
    {/* These methods below are loading before the component mounts */}
    <ul>
      <NavLink>Google Books</NavLink>
      <NavLink>Saved</NavLink>
      <NavLink>Search</NavLink>
    </ul>
  </div>;
};

export default NavBar;
